import styles from './MenuItem.module.scss'

function MenuItem({data, onclick, onback, stylerow}) {

    return (
        <div className={styles['wrapper-menu-item']} onClick={onclick}>
            <span  className={styles['left-icon']}>{data.iconSeeMore}</span>
            {data.title}            
        </div>
     );
}

export default MenuItem;
